script: |
  super -f text -I q8805.spq | sort > q8805.out

inputs:
  - name: q8805.spq
    data: |
      SELECT DISTINCT col2 * + + col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col1 * - + col1 + + 55 NOT BETWEEN ( + 68 + - col2 ) AND NULL;
  - name: tab1

outputs:
  - name: q8805.out
    data: |
